import React from 'react'
import styled from 'styled-components'

function Story() {
    return (
        <Storyy>
            <StoryyCtn>
                <Left></Left>
                <Right></Right>
            </StoryyCtn>
        </Storyy>
    )
}

export default Story

const Storyy = styled.div`
height: 100vh;
width: 100vh;

display: flex;
flex-direction: column;
`
const StoryyCtn = styled.div`
height: 100vh;
width: 100vh;

display: flex;
flex-direction: row;
`

const Right = styled.div`
width: 50%;
height: 50%;


`
const Left = styled.div`
width: 50%;
height: 50%;


`
